// src/App.js
import { Routes, Route, Link } from 'react-router-dom'; // ðŸ‘ˆ Importar
import HomePage from './pages/home'; // Suponiendo que tienes componentes para cada pÃ¡gina
import ProfilePage from './pages/ProfilePage';
import NotFoundPage from './pages/NotFoundPage';

function App() {
  return (
    <div>
      {/* Barra de navegaciÃ³n principal */}
      <nav>
        <Link to="/">Inicio</Link> | <Link to="/perfil">Perfil</Link>
      </nav>
      <hr />

      {/* AquÃ­ se define quÃ© componente renderizar para cada ruta */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/perfil" element={<ProfilePage />} />
        <Route path="*" element={<NotFoundPage />} /> {/* Ruta para 404 */}
      </Routes>
    </div>
  );
}

export default App;
